import {Pokemon} from "../model/Pokemon";
import * as React from "react";
import {EntryBox} from "./EntryBox";

interface IProps {
    pokemonList: Pokemon[]
}

export function PokemonList(props: IProps) {

    return (
        <div>
            <table>
                <thead>
                <tr>
                    <th>#</th>
                    <th>Name</th>
                    <th>Types</th>
                    <th>Weight</th>
                </tr>
                </thead>
                <tbody>
                {props.pokemonList.map(pokemon => (
                    <tr key={pokemon.id}>
                        <EntryBox pokemon={pokemon}/>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    )

}
